    "fort-peck-game-range-narrative-report-september-october-november-december-1942",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    outlines Refuge accomplishments from September through December of 1942. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments. The public relations section
    of the report describes Refuge visitors. N-R forms are attached.",nt"license_title":
